public Action OnPlayerRunCmd(int client, int &buttons, int &impulse, float vel[3], float angles[3], int &weapon)
{
	if (!Enabled || !IsPlayerAlive(client) || !IsClientBot(client)) return Plugin_Continue;
	int rocket = INVALID_ENT_REFERENCE;
	float fClientEyePosition[3];
	GetClientEyePosition(client, fClientEyePosition);
	int iWeapon = GetEntPropEnt(client, Prop_Send, "m_hActiveWeapon");
	if (!IsValidEntity(iWeapon))return Plugin_Continue;
	float vCamAngle[3];
	
	while ((rocket = FindEntityByClassname(rocket, "tf_projectile_*")) != INVALID_ENT_REFERENCE)
	{
		float fRocketLocation[3];
		GetEntPropVector(rocket, Prop_Data, "m_vecOrigin", fRocketLocation);
		int rocketTeam = GetEntProp(rocket, Prop_Data, "m_iTeamNum");
		float fClientLocation[3];
		GetClientAbsOrigin(client, fClientLocation);
		float fRocketAngle[3];
		fRocketAngle[0] = 0.0 - RadToDeg(ArcTangent((fRocketLocation[2] - fClientEyePosition[2]) / (FloatAbs(SquareRoot(Pow(fClientEyePosition[0] - fRocketLocation[0], 2.0) + Pow(fRocketLocation[1] - fClientEyePosition[1], 2.0))))));
		fRocketAngle[1] = GetAngle(fClientEyePosition, fRocketLocation);
		if (botOrbit && GetVectorDistance(fClientLocation, fRocketLocation) < 500.0 && rocketTeam != GetClientTeam(client))
		{
			float fRocketVelocity[3];
			GetEntPropVector(rocket, Prop_Data, "m_vecAbsVelocity", fRocketVelocity);
			//Convert to MPH by multiplying by (15/352)
			if (RoundFloat(GetVectorLength(fRocketVelocity) * (15.0/352.0)) >= g_flMaxOrbitSpeed) botOrbit = false;
			
			if (GetVectorDistance(fClientLocation, fRocketLocation) < 90.0)
			{
				float fNextRocketLocation[3];
				CopyVector(GetFuturePos(fRocketLocation, fRocketVelocity, 0.1), fNextRocketLocation);
				Handle tr = TR_TraceRayFilterEx(fRocketLocation, fNextRocketLocation, MASK_SHOT, RayType_EndPoint, TraceRayFilterClients, client);
			
				if (!TR_DidHit(tr))
				{
					//PrintToServer("Rocket won't hit, orbiting.");
					delete tr;
					
					GetVectorAnglesTwoPoints(fClientEyePosition, fRocketLocation, vCamAngle);
					AnglesNormalize(vCamAngle);
					CopyVector(fRocketAngle, angles);
					
					float vMoveAng[3];
					GetVectorAngles(vel, vMoveAng);
						
					float flYaw = DegToRad(vCamAngle[1] - angles[1] + vMoveAng[1]);
					float flSpeed = SquareRoot((vel[0] * vel[0]) + (vel[1] * vel[1]));
					vel[0] = Cosine(flYaw) * flSpeed;
					vel[1] = Sine(flYaw) * flSpeed;
					
					float fMoveVector[3];
					MakeVectorFromPoints(fClientLocation, fRocketLocation, fMoveVector);
					
					NormalizeVector(fMoveVector, fMoveVector);
					ScaleVector(fMoveVector, -300.0);
					
					PrintToServer("fMoveVector: [%f, %f, %f]", fMoveVector[0], fMoveVector[1], fMoveVector[2]);
				
					TeleportEntity(client, NULL_VECTOR, NULL_VECTOR, fMoveVector);
				}
				else if (TR_DidHit(tr))
				{
					//PrintToServer("Rocket will hit, not orbiting.");
					delete tr;
					TeleportEntity(client, NULL_VECTOR, fRocketAngle, NULL_VECTOR);
					ModRateOfFire(iWeapon);
					buttons |= IN_ATTACK2;
					return Plugin_Continue;
				}
			}
			
			static float flNextAirblastTime;
				
			if(flNextAirblastTime <= GetEngineTime())
			{
				TeleportEntity(client, NULL_VECTOR, fRocketAngle, NULL_VECTOR);
				ModRateOfFire(iWeapon);
				buttons |= IN_ATTACK2;
				flNextAirblastTime = GetEngineTime() + GetRandomFloat(1.00, g_flMaxOrbitTime);
				//PrintToServer("Orbit over, airblasting. Next AB time: %f", flNextAirblastTime);
			}
			
			GetVectorAnglesTwoPoints(fClientEyePosition, fRocketLocation, vCamAngle);
			AnglesNormalize(vCamAngle);
			CopyVector(fRocketAngle, angles);
			
			float vMoveAng[3];
			GetVectorAngles(vel, vMoveAng);
			
			float flYaw = DegToRad(vCamAngle[1] - angles[1] + vMoveAng[1]);
			float flSpeed = SquareRoot((vel[0] * vel[0]) + (vel[1] * vel[1]));
			vel[0] = Cosine(flYaw) * flSpeed;
			vel[1] = Sine(flYaw) * flSpeed;
			
			float fMoveVector[3];
			MakeVectorFromPoints(fClientLocation, fRocketLocation, fMoveVector);
			
			NormalizeVector(fMoveVector, fMoveVector);
			ScaleVector(fMoveVector, -300.0);
			
			TeleportEntity(client, NULL_VECTOR, NULL_VECTOR, fMoveVector);
			return Plugin_Continue;
		}
		else if (!botOrbit && GetVectorDistance(fClientLocation, fRocketLocation) < 250.0 && rocketTeam != GetClientTeam(client))
		{
			TeleportEntity(client, NULL_VECTOR, fRocketAngle, NULL_VECTOR);
			ModRateOfFire(iWeapon);
			buttons |= IN_ATTACK2;
			return Plugin_Continue;
		}
		else
		{
			float fTargetLocation[3];
			float targetAngle[3];
			
			if (aimTarget == 0 || !IsPlayerAlive(aimTarget))
			{
				for (int i = 1; i <= MaxClients; i++)
				{
					if (IsClientInGame(i) && IsClientConnected(i) && !IsClientObserver(i) && GetClientTeam(i) != GetClientTeam(client) && IsPlayerAlive(i))
					{
						aimTarget = i;
						GetClientEyePosition(i, fTargetLocation);
						targetAngle[0] = 0.0 - RadToDeg(ArcTangent((fTargetLocation[2] - fClientEyePosition[2]) / (FloatAbs(SquareRoot(Pow(fClientEyePosition[0] - fTargetLocation[0], 2.0) + Pow(fTargetLocation[1] - fClientEyePosition[1], 2.0))))));
						targetAngle[1] = GetAngle(fClientEyePosition, fTargetLocation);
						if (g_bBotMimic)
						{
							float targetVel[3];
							GetEntPropVector(aimTarget, Prop_Data, "m_vecAbsVelocity", targetVel);
							float clientVel[3];
							MirrorVelocity(targetVel, clientVel);
							TeleportEntity(client, NULL_VECTOR, targetAngle, clientVel);
						}
						else TeleportEntity(client, NULL_VECTOR, targetAngle, NULL_VECTOR);
					}
				}
			}
			else
			{
				GetClientEyePosition(aimTarget, fTargetLocation);
				targetAngle[0] = 0.0 - RadToDeg(ArcTangent((fTargetLocation[2] - fClientEyePosition[2]) / (FloatAbs(SquareRoot(Pow(fClientEyePosition[0] - fTargetLocation[0], 2.0) + Pow(fTargetLocation[1] - fClientEyePosition[1], 2.0))))));
				targetAngle[1] = GetAngle(fClientEyePosition, fTargetLocation);
				if (g_bBotMimic)
				{
					float targetVel[3];
					GetEntPropVector(aimTarget, Prop_Data, "m_vecAbsVelocity", targetVel);
					float clientVel[3];
					MirrorVelocity(targetVel, clientVel);
					TeleportEntity(client, NULL_VECTOR, targetAngle, clientVel);
				}
				else TeleportEntity(client, NULL_VECTOR, targetAngle, NULL_VECTOR);
			}
		}
	}
	return Plugin_Continue;
}

public void AnglesNormalize(float vAngles[3])
{
	while(vAngles[0] >  89.0) vAngles[0]-=360.0;
	while(vAngles[0] < -89.0) vAngles[0]+=360.0;
	while(vAngles[1] > 180.0) vAngles[1]-=360.0;
	while(vAngles[1] <-180.0) vAngles[1]+=360.0;
}

public void CopyVector(float vIn[3], float vOut[3])
{
	vOut[0] = vIn[0];
	vOut[1] = vIn[1];
	vOut[2] = vIn[2];
}

public bool TraceRayFilterClients(int iEntity, int iMask, any hData)
{
	if(iEntity > 0 && iEntity <= MaxClients)
	{
		if(iEntity == hData)
		{
			return true;
		}
		else
		{
			return false;
		}
	}

	return true;
}

stock bool IsClientBot(int client)
{
	return client != 0 && IsClientInGame(client) && IsFakeClient(client) && !IsClientReplay(client) && !IsClientSourceTV(client);
}

stock void ModRateOfFire(int weapon)
{
	float m_flNextPrimaryAttack = GetEntPropFloat(weapon, Prop_Send, "m_flNextPrimaryAttack");
	float m_flNextSecondaryAttack = GetEntPropFloat(weapon, Prop_Send, "m_flNextSecondaryAttack");
	SetEntPropFloat(weapon, Prop_Send, "m_flPlaybackRate", 10.0);

	float fGameTime = GetGameTime();
	float fPrimaryTime = ((m_flNextPrimaryAttack - fGameTime) - 0.99);
	float fSecondaryTime = ((m_flNextSecondaryAttack - fGameTime) - 0.99);

	SetEntPropFloat(weapon, Prop_Send, "m_flNextPrimaryAttack", fPrimaryTime + fGameTime);
	SetEntPropFloat(weapon, Prop_Send, "m_flNextSecondaryAttack", fSecondaryTime + fGameTime);
}

stock float GetAngle(const float coords1[3], const float coords2[3])
{
	float angle = RadToDeg(ArcTangent((coords2[1] - coords1[1]) / (coords2[0] - coords1[0])));
	if (coords2[0] < coords1[0])
	{
	if (angle > 0.0) angle -= 180.0;
	else angle += 180.0;
	}
	return angle;
}

stock float GetVectorAnglesTwoPoints(const float vStartPos[3], const float vEndPos[3], float vAngles[3])
{
	static float tmpVec[3];
	tmpVec[0] = vEndPos[0] - vStartPos[0];
	tmpVec[1] = vEndPos[1] - vStartPos[1];
	tmpVec[2] = vEndPos[2] - vStartPos[2];
	GetVectorAngles(tmpVec, vAngles);
}

stock void MirrorVelocity(const float vel[3], float buffer[3])
{
	buffer[0] = -vel[0];
	buffer[1] = -vel[1];
	buffer[2] = 0.00;
}

stock float GetFuturePos(float currPos[3], float currVel[3], float time/*, bool:predFalloff*/)
{
	// predpos = x_0 + vel*time
	float productVec[3];
	float currPosCopy[3];
	float currVelCopy[3];
	currPosCopy = currPos;
	currVelCopy = currVel;
	
	ScaleVector(currVelCopy, time);
	AddVectors(currPosCopy, currVelCopy, productVec);
	
	return productVec;
}

stock void UpdatePlayerHitbox(const int client)
{
	static const float vecTF2PlayerMin[3] =  { -24.5, -24.5, 0.0 }; 
	static const float vecTF2PlayerMax[3] =  { 24.5, 24.5, 83.0 };
	float vecScaledPlayerMin[3]; 
	float vecScaledPlayerMax[3];
	vecScaledPlayerMin = vecTF2PlayerMin;
	vecScaledPlayerMax = vecTF2PlayerMax;
	SetEntPropVector(client, Prop_Send, "m_vecSpecifiedSurroundingMins", vecScaledPlayerMin);
	SetEntPropVector(client, Prop_Send, "m_vecSpecifiedSurroundingMaxs", vecScaledPlayerMax);
}

stock void ChangePlayerTeam()
{
	for (int i = 1; i <= MaxClients; i++)
	{
		if (IsClientInGame(i) && !IsFakeClient(i) && !IsClientObserver(i) && GetClientTeam(i) != 2)
		{
			ChangeClientTeam(i, 2);
			TF2_RespawnPlayer(i);
		}
		if (IsClientInGame(i) && IsFakeClient(i) && !IsClientObserver(i) && GetClientTeam(i) != 3)
		{
			ChangeClientTeam(i, 3);
			TF2_RespawnPlayer(i);
		}
	}
}

