typedef struct
{
	double **M;
	int n, m;
} mmatrix;

//mmatrix A; A.n es equivalente (&A)->n
// mmatrix *X; X->n es equivalente a (*X).n
void freematr(mmatrix *A)
{
	if (A)
	{
		if (A->M != 0)
		{
			for (int i = 0; i < A->n; ++i)
				free(A->M[i]);
			free(A->M);
		}
		free(A);
	}
}

mmatrix *memmatr(int filas, int columnas)
{
	int i;
	mmatrix *A;
	A = (mmatrix*)malloc(sizeof(mmatrix));
	if (!A) return 0;
	A->n = filas;
	A->m = columnas;
	A->M = (double**)malloc(filas*sizeof(double*));
	if (A->M == 0) return 0;
	for (i = 0; i < filas; ++i)
	{
		A->M[i] = (double*)malloc(columnas*sizeof(double));
		if (A->M[i] == 0)
		{
			A->n = i;
			freematr(A);
			return 0;
		}
	}
	return A;
}

mmatrix *mulmat(mmatrix *A, mmatrix *B)
{
	mmatrix *C;
	if (A->m != B->n) return 0;
	C = memmatr(A->n, B->m);
	if (C)
	{
		for (int j = 0; j < A->n; ++j)
			for (int i = 0; i < B->m; ++i)
			{
				C->M[j][i] = 0.0;
				for (int k = 0; k < A->m; ++k)
					C->M[j][i] += A->M[j][k]*B->M[k][i];
			}
	}
	return C;
}

void printmmatrix(mmatrix *A)
{
	int i, j;
	for (i = 0; i < A->n; ++i)
	{
		for (j = 0; j < A->m; ++j)
			printf ("\t%g", A->M[i][j]);
		printf ("\n");
	}
}

int main()
{
	mmatrix *A, *B, *C;
	int n, m, i, j;
	while (1)
	{
		printf("\nIntroduzca numero de filas y columnas de la primera matriz: ");
		scanf("%d %d", &n, &m);
		if (n <= 0 || m <= 0) break;
		A = memmatr(n,m);
		if (!A) break;
		printf("Introduzca los datos de la matriz por filas:\n");
		for (i = 0; i < n; ++i)
			for (j = 0; j < m; ++j)
				scanf("%lf", &A->M[i][j]);
		printf("Introduzca numero de filas y columnas de la segunda matriz: ");
		scanf("%d %d", &n, &m);
		if (n <= 0 || m <= 0) break;
		B = memmatr(n,m);
		if (!B) break;
		printf("Introduzca los datos de la matriz por filas:\n");
		for (i = 0; i < n; ++i)
			for (j = 0; j < m; ++j)
				scanf("%lf", &B->M[i][j]);
		C = mulmat(A, B);
		if (C)
		{
			printf ("A x B:\n");
			printmmatrix(C);
		}
		freematr(A);
		freematr(B);
		freematr(C);
	}
	
#ifdef _WIN32
	system("pause");
#endif
	return 0;
}

