int Pedal2press = 0;

void setup() 
{
  // make pins 2,4,7,8 an input and use the 
  // internal resistor (pullup) so it reads high
  // unless connected to ground:
  pinMode(2, INPUT_PULLUP); // kick drum pedal input
  pinMode(8, INPUT_PULLUP); // hi-hat pedal input
  pinMode(4, INPUT_PULLUP); // red button (mute mic)
  pinMode(7, INPUT_PULLUP); // blue button (mute channel)
    
  //  Serial.begin(9600);  // begin serial comms for debugging
  Keyboard.begin();
}

void loop()
{
  if(digitalRead(2)==LOW && Pedal1press !=1)  // kick drum pedal press
  {  
	Keyboard.write(32);  // send spacebar
    Pedal1press = 1;  // prevent repeat signal 
    delay(50);
  }
  
  if(digitalRead(2)==HIGH)  // kick pedal was released
  {  
	Pedal1press = 0;  // allow pedal press to register next loop
  }

  if(digitalRead(8)==LOW  && Pedal2press !=1)  // hi-hat pedal press
  {  
	Keyboard.press(KEY_LEFT_CTRL);
    //  Keyboard.press(50);  //4testing
    Pedal2press = 1;  // prevent repeat signal 
    delay(50);
  }
    
  if(digitalRead(8)==HIGH && Pedal2press ==1)  // hi-hat pedal was released
  {
    Keyboard.release(KEY_LEFT_CTRL);
    //  Keyboard.release(50);  //4testing
    Pedal2press = 0;  // allow pedal press to register next loop
    delay(50);
  }
    
