	heap->noStudends++;
	while (current != 0) {
		int parentIndex = getParent(current);
		if (heap->students[parentIndex]->age < heap->students[current]->age) {
			swap(heap, parentIndex, current);
			current = parentIndex;
		}
		else
			current = 0;
	}
}

