void polznominal_multi(const int64_t lhs, const int64_t rhs, int64_t ** out, bool* neg)
    {
        
        bool               negative = (lhs < 0) xor (rhs < 0);
        #define mask    ((1ull << 32) - 1)

        // (x1*BaseM + x0) * (y1*BaseM + y0)
        // = x1y1*BaseM^2 + x1y0*BaseM + x0y1*BaseM + x0y0;
        uint64_t x     = uabs(lhs);
        uint64_t y     = uabs(rhs);
        uint64_t x0    = x & mask;
        uint64_t x1    = x >> 32;
        uint64_t y0    = y & mask;
        uint64_t y1    = y >> 32;
        uint64_t z2    = x1 * y1; //x1y1*BaseM^2
        uint64_t z1_0  = x1 * y0; //x1y0*BaseM
        uint64_t z1_1  = x0 * y1; //x0y1*BaseM
        uint64_t z0    = x0 * y0; //x0y0
        uint64_t z1;
        uint64_t carry = 0;
        {
			uint64_t result;
            overflow = builtin_add_overflow_silent(z1_1, z1_0, &result); // x1y0*BaseM + x0y1*BaseM
            z1 = result;
            if (overflow) {
                carry += 1 << 32;
            }
        }
        z1_1           = z1 >> 32;
        z1_0           = z1 << 32;
		uint64_t result;
		overflow = builtin_add_overflow_silent(z0, z1_0, &result);
        if (overflow) {
            carry += 1;
        }
        auto result1 = z2 + z1_1 + carry;
		*out[0] = result0;
		*out[1] = result1;
		*neg = negative;
    }

// builtin_add_overflow_silent returns a tuple with the result and a bool for the overflow which is the carry bit in this case
// uabs is just like std::abs but returns unsignet and takes care of posible overflow when converting max negative value

