#include <iostream>
#include <stack>
#include <string>

int ev(int val1, char op, int val2) {

    switch (op) {
        case '+': return val1 + val2;

        case '-': return val1 - val2;

        case '*': return val1 * val2;

        case '/': return val1 / val2;

        default: return 0;
    }

}

int priority(char op) {
    if (op == '*' || op == '/') return 2;
    if (op == '+' || op == '-') return 1;
    return 0;
}

std::string ev(std::string expression) {

    // output postfix notation.
    std::string output;
    // stack to store operators.
    std::stack<char> operators;

    for (int i = 0; i < expression.size(); ++i) {

        // Current token is a whitespace,
        // skip it.
        if (expression[i] == ' ')
            continue;

        // Current token is an opening
        // brace, push it to 'ops'
        if (expression[i] == '(') {
            operators.push('(');
        } else if (isdigit(expression[i])) {
            std::string num;

            while (i < expression.size() && isdigit(expression[i])) {
                num += expression[i];
                i++;
            }

            output += num + ' ';
        }
        // Closing brace encountered, solve
        // entire brace.
        else if (expression[i] == ')') {
            while (!operators.empty() && operators.top() != '(') {
                output += operators.top();
                output += ' ';
                operators.pop();
            }
            //pop opening brace
            operators.pop();
        }
        //operator
        else {
            char rightOp = expression[i];
            while (!operators.empty() && (priority(operators.top()) >= priority(rightOp))) {
                output += operators.top();
                output += ' ';
                operators.pop();
            }
            operators.push(rightOp);
        }


    }

    while(!operators.empty()) {
        output += operators.top();
        output += ' ';
        operators.pop();
    }

    return output;
}


int main() {

    std::cout << ev("10 + 2 * 6") << "\n";
    std::cout << ev("100 * 2 + 12") << "\n";
    std::cout << ev("100 * ( 2 + 12 )") << "\n";
    std::cout << ev("100 * ( 2 + 12 ) / 14");
    return 0;


}

