	double delta = 0.25;
	double CFF_start = (r_min + delta*DELTA)/r_min;
	double CFF_final = (r_min + (1-delta)*DELTA)/r_min;
	//tooth root
	double theta_start = sqrt(pow(CFF_start,2) - 1);
	pA = -r_min*theta_start*cos(theta_start) + r_min*sin(theta_start);
	pB =  r_min*theta_start*sin(theta_start) + r_min*cos(theta_start);
	double theta_st = atan(pA/pB);
	//tooth tip
	double theta_final = sqrt(pow(CFF_final,2) - 1);
	pA = -r_min*theta_final*cos(theta_final) + r_min*sin(theta_final);
	pB =  r_min*theta_final*sin(theta_final) + r_min*cos(theta_final);
	double theta_fn = atan(pA/pB);
	double r_val = r_min*sqrt(1 + pow(theta_start,2));
	double r_tip = r_min*sqrt(1 + pow(theta_final,2));
	//tooth angles
	double theta_r = 2*theta_x + theta_t;
	double theta_m = theta_r - 2*theta_fn;
	double theta_v = theta_s - theta_r + 2*theta_st;
	double R_clear = theta_m*r_tip/(theta_v*r_val);
