		gearIn->fA_Y[0][z] =  r_min*T_z*sin(T_z) + r_min*cos(T_z);
	}
	double T_fix = theta_r;
	for (z = 0; z < N_g; z++) {
		gearIn->fB_X[0][z] = -gearIn->fA_X[0][z]*cos(T_fix) + 
						  gearIn->fA_Y[0][z]*sin(T_fix);
		gearIn->fB_Y[0][z] = gearIn->fA_X[0][z]*sin(T_fix) + 
						 gearIn->fA_Y[0][z]*cos(T_fix);
	}
	double qX = r_tip*sin(theta_fn);
	double qY = r_tip*cos(theta_fn);
	double capAng[N_c]; linSpace(capAng,0.0,theta_m,N_c);
	for (z = 0; z < N_c; z++) {
		double T_z = capAng[z];
		gearIn->fU_X[0][z] =  qX*cos(T_z) + qY*sin(T_z);
		gearIn->fU_Y[0][z] = -qX*sin(T_z) + qY*cos(T_z);
		
	}
