package fr.aragone.main;

import org.bukkit.Material;
import org.bukkit.command.Command;
import org.bukkit.command.CommandExecutor;
import org.bukkit.command.CommandSender;
import org.bukkit.entity.Player;
import org.bukkit.inventory.ItemStack;
import org.bukkit.inventory.meta.ItemMeta;

public class TrocPlugin implements CommandExecutor {

	private int checkInventory;
	public static ItemStack chest1;
	public static ItemStack chest2;
	
	public void giveItems(Player player) {
		
		ItemStack chest1 = new ItemStack(Material.CHEST);
		ItemStack chest2 = new ItemStack(Material.CHEST);
		ItemMeta meta1 = chest1.getItemMeta();
		ItemMeta meta2 = chest2.getItemMeta();
		
		meta1.setDisplayName("§a§lJoueur 1");
		meta2.setDisplayName("§c§lJoueur 2");
		
		chest1.setItemMeta(meta1);
		chest2.setItemMeta(meta2);
		
		player.getInventory().addItem(chest1);
		player.getInventory().addItem(chest2);
		
	}
	
	@Override
	public boolean onCommand(CommandSender sender, Command cmd, String msg, String[] args) {
		
		if(sender instanceof Player) {
			Player player = (Player) sender;
			
			if(cmd.getName().equalsIgnoreCase("troc")) {
				if(args.length != 0) {
					player.sendMessage("§cLa commande est /troc");
				}else {
				
					checkInventory = player.getInventory().firstEmpty();
					
					if(checkInventory == -1) {
						player.sendMessage("§cVidez votre inventaire pour effectuer cette commande.");
					}else {
						giveItems(player);
					}
					
				}
				return true;
			}
		}
		return false;
	}

}

